import { UserActionTypes } from './user-types';

interface setCurrentUserAction {
  type: UserActionTypes.SET_CURRETN_USER;
  payload: object;
}

export const setCurrentUser: setCurrentUserAction = (user: object) => ({
  type: UserActionTypes.SET_CURRETN_USER,
  payload: user,
});
